    @State private var currentFrame = 0
        @State private var isReversing = false // Pour gérer le retour
        private let animationSpeed = 0.2 // Ajustez la vitesse en secondes
        
        var body: some View {
            VStack {
                PixelGrid(colors: frames[currentFrame], pixelSize: pixelSize)
                    .frame(width: totalWidth, height: totalWidth)
                    .onAppear {
                        startAnimation()
                    }
            }
        }
        
        func startAnimation() {
            Timer.scheduledTimer(withTimeInterval: animationSpeed, repeats: true) { timer in
                if isReversing {
                    currentFrame -= 1
                    if currentFrame == 0 { isReversing = false }
                } else {
                    currentFrame += 1
                    if currentFrame == frames.count - 1 { isReversing = true }
                }
            }
        }
    }

    struct PixelGrid: View {
        let colors: [[Color]]
        let pixelSize: CGFloat
        
        var body: some View {
            VStack(spacing: 0.5) {
                ForEach(0..<colors.count, id: \.self) { rowIndex in
                    HStack(spacing: 0.5) {
                        ForEach(0..<colors[rowIndex].count, id: \.self) { colIndex in
                            Rectangle()
                                .fill(colors[rowIndex][colIndex])
                                .frame(width: pixelSize, height: pixelSize)
                        }
                    }
                }
            }
        }
    }

    struct PixelArtView_Previews: PreviewProvider {
        static var previews: some View {
            PixelArtView()
        }
    }
